Description
Middleweight champion Anderson Silva returns to Brazil to ready himself at home
for the toughest test of his career; meanwhile, Long Island's Chris Weidman works
day in and day out in the hopes of becoming the next UFC champion. Frankie Edgar's
out to prove he still belongs at the top of his new division; Charles Oliveira
wants to crack the top ten by pulling off the upset. Watch as they get ready for
Saturday's co-main event. Two ferocious 45er strikers who also have submissions
prepare for a bout that will reshape the jam-packed featherweight division. See
how Cub Swanson and Dennis Siver are looking to make a case for a title shot at
UFC 162.

